int main() {
    int N;
    scanf("%d", &N);

    while (N--) {
        char num1[105], num2[105], result[105];
        scanf("%s %s", num1, num2);

        int len1 = strlen(num1);
        int len2 = strlen(num2);

        // Check if input has more than 80 digits
        if (len1 > 80 || len2 > 80) {
            printf("overflow\n");
            continue;
        }

        // Reverse the strings for easier addition
        reverseString(num1);
        reverseString(num2);

        int maxLen = (len1 > len2) ? len1 : len2;
        int carry = 0;
        int resultLen = 0;

        for (int i = 0; i < maxLen || carry; i++) {
            int digit1 = (i < len1) ? (num1[i] - '0') : 0;
            int digit2 = (i < len2) ? (num2[i] - '0') : 0;

            int sum = digit1 + digit2 + carry;
            result[resultLen++] = (sum % 10) + '0';
            carry = sum / 10;
        }

        result[resultLen] = '\0';

        // Check if result has more than 80 digits
        if (resultLen > 80) {
            printf("overflow\n");
            continue;
        }

        // Reverse result back
        reverseString(result);

        printf("%s\n", result);
    }

    return 0;
}

