public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int[][] paper = new int[10][10];

        while (sc.hasNext()) {
            String line = sc.nextLine();
            String[] parts = line.split(",");
            int x = Integer.parseInt(parts[0]);
            int y = Integer.parseInt(parts[1]);
            int size = Integer.parseInt(parts[2]);

            dropInk(paper, x, y, size);
        }

        int zeroCells = 0;
        int maxDensity = 0;

        for (int i = 0; i < 10; i++) {
            for (int j = 0; j < 10; j++) {
                if (paper[i][j] == 0) {
                    zeroCells++;
                }
                maxDensity = Math.max(maxDensity, paper[i][j]);
            }
        }

        System.out.println(zeroCells);
        System.out.println(maxDensity);

        sc.close();
    }

    static void dropInk(int[][] paper, int x, int y, int size) {
        if (size == 1) {
            // Small: only center
            if (isValid(x, y)) {
                paper[y][x]++;
            }
        } else if (size == 2) {
            // Medium: cross pattern with radius 1
            int[][] offsets = {
                {0, 0},
                {-1, 0}, {1, 0}, {0, -1}, {0, 1}
            };
            for (int[] offset : offsets) {
                int nx = x + offset[0];
                int ny = y + offset[1];
                if (isValid(nx, ny)) {
                    paper[ny][nx]++;
                }
            }
        } else if (size == 3) {
            // Large: diamond pattern with radius 2
            int[][] offsets = {
                {0, 0},
                {-1, 0}, {1, 0}, {0, -1}, {0, 1},
                {-2, 0}, {2, 0}, {0, -2}, {0, 2},
                {-1, -1}, {-1, 1}, {1, -1}, {1, 1}
            };
            for (int[] offset : offsets) {
                int nx = x + offset[0];
                int ny = y + offset[1];
                if (isValid(nx, ny)) {
                    paper[ny][nx]++;
                }
            }
        }
    }

    static boolean isValid(int x, int y) {
        return x >= 0 && x < 10 && y >= 0 && y < 10;
    }
}

