import java.util.*;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (sc.hasNextLine()) {
            String line = sc.nextLine().trim();
            if (line.isEmpty()) break;

            String[] cards = line.split(",");
            int[] hand = new int[5];
            for (int i = 0; i < 5; i++) {
                hand[i] = Integer.parseInt(cards[i]);
            }

            System.out.println(evaluateHand(hand));
        }

        sc.close();
    }

    static String evaluateHand(int[] hand) {
        int[] count = new int[14];
        for (int card : hand) {
            count[card]++;
        }

        // Check for four card
        for (int i = 1; i <= 13; i++) {
            if (count[i] == 4) {
                return "four card";
            }
        }

        // Check for full house
        boolean hasThree = false;
        boolean hasTwo = false;
        for (int i = 1; i <= 13; i++) {
            if (count[i] == 3) hasThree = true;
            if (count[i] == 2) hasTwo = true;
        }
        if (hasThree && hasTwo) {
            return "full house";
        }

        // Check for straight
        if (isStraight(hand)) {
            return "straight";
        }

        // Check for three card
        if (hasThree) {
            return "three card";
        }

        // Check for two pair
        int pairCount = 0;
        for (int i = 1; i <= 13; i++) {
            if (count[i] == 2) pairCount++;
        }
        if (pairCount == 2) {
            return "two pair";
        }

        // Check for one pair
        if (pairCount == 1) {
            return "one pair";
        }

        return "null";
    }

    static boolean isStraight(int[] hand) {
        int[] sorted = hand.clone();
        Arrays.sort(sorted);

        // Check normal straight
        boolean isConsecutive = true;
        for (int i = 1; i < 5; i++) {
            if (sorted[i] != sorted[i-1] + 1) {
                isConsecutive = false;
                break;
            }
        }
        if (isConsecutive) return true;

        // Check A-2-3-4-5
        if (sorted[0] == 1 && sorted[1] == 2 && sorted[2] == 3 && sorted[3] == 4 && sorted[4] == 5) {
            return true;
        }

        // Check 10-J-Q-K-A
        if (sorted[0] == 1 && sorted[1] == 10 && sorted[2] == 11 && sorted[3] == 12 && sorted[4] == 13) {
            return true;
        }

        return false;
    }
}

