int gcd(int a, int b) {
    if (b == 0) return a;
    return gcd(b, a % b);
}

int mod_inverse(int a, int m) {
    for (int i = 1; i < m; i++) {
        if ((a * i) % m == 1) return i;
    }
    return -1;
}

void decrypt(char *text, int alpha, int beta, char *result) {
    int alpha_inv = mod_inverse(alpha, 26);
    if (alpha_inv == -1) {
        result[0] = '\0';
        return;
    }

    int len = strlen(text);
    for (int i = 0; i < len; i++) {
        if (isalpha(text[i])) {
            int c = text[i] - 'a';
            int decoded = (alpha_inv * (c - beta + 26)) % 26;
            if (decoded < 0) decoded += 26;
            result[i] = decoded + 'a';
        } else {
            result[i] = text[i];
        }
    }
    result[len] = '\0';
}

int contains_word(char *text, char *word) {
    int text_len = strlen(text);
    int word_len = strlen(word);

    for (int i = 0; i <= text_len - word_len; i++) {
        if (i > 0 && isalpha(text[i-1])) continue;
        if (i + word_len < text_len && isalpha(text[i + word_len])) continue;

        int match = 1;
        for (int j = 0; j < word_len; j++) {
            if (text[i + j] != word[j]) {
                match = 0;
                break;
            }
        }
        if (match) return 1;
    }
    return 0;
}

