    keywords = ["that", "this"]

    for alpha in range(1, 26):
        if gcd(alpha, 26) != 1:
            continue

        for beta in range(26):
            decrypted = decrypt_text(encrypted, alpha, beta)

            for keyword in keywords:
                if keyword in decrypted:
                    return decrypted

    return encrypted

