import java.util.*;

public class Main {
    static class Expr {
        String str;
        int val;
        Expr(String s, int v) {
            str = s;
            val = v;
        }
    }

    static String result;
    static boolean found;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int a = sc.nextInt();
            int b = sc.nextInt();
            int c = sc.nextInt();
            int d = sc.nextInt();

            if (a == 0 && b == 0 && c == 0 && d == 0) break;

            int[] nums = {a, b, c, d};
            result = null;
            found = false;

            permute(nums, 0);

            if (result != null) {
                System.out.println(result);
            } else {
                System.out.println("0");
            }
        }
    }

    static void permute(int[] nums, int start) {
        if (found) return;

        if (start == nums.length) {
            solve(nums);
            return;
        }

        for (int i = start; i < nums.length; i++) {
            swap(nums, start, i);
            permute(nums, start + 1);
            swap(nums, start, i);
            if (found) return;
        }
    }

    static void swap(int[] nums, int i, int j) {
        int temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }

    static void solve(int[] nums) {
        List<Expr> exprs = new ArrayList<>();
        for (int num : nums) {
            exprs.add(new Expr(String.valueOf(num), num));
        }

        generate(exprs);
    }

    static void generate(List<Expr> exprs) {
        if (found) return;

        if (exprs.size() == 1) {
            if (exprs.get(0).val == 10) {
                result = exprs.get(0).str;
                found = true;
            }
            return;
        }

        for (int i = 0; i < exprs.size(); i++) {
            for (int j = 0; j < exprs.size(); j++) {
                if (i == j) continue;

                Expr e1 = exprs.get(i);
                Expr e2 = exprs.get(j);

                char[] ops = {'+', '-', '*'};

                for (char op : ops) {
                    int newVal = calc(e1.val, e2.val, op);
                    String newStr = "(" + e1.str + " " + op + " " + e2.str + ")";

                    List<Expr> newExprs = new ArrayList<>();
                    for (int k = 0; k < exprs.size(); k++) {
                        if (k != i && k != j) {
                            newExprs.add(exprs.get(k));
                        }
                    }
                    newExprs.add(new Expr(newStr, newVal));

                    generate(newExprs);
                    if (found) return;
                }
            }
        }
    }

    static int calc(int a, int b, char op) {
        switch (op) {
            case '+': return a + b;
            case '-': return a - b;
            case '*': return a * b;
        }
        return 0;
    }
}

