	final int front = a[0];
	for ( int i = 0; i < 7; i++ ) {
	    a[i] = a[i + 1];
	}
	a[7] = front;
    }

    static int ip( int[] ps, int[] ls ) {
	int sum = 0;
	for ( int i = 0; i < ps.length; i++ ){
	    sum += min( ls[i], ps[i] );
	}
	return sum;
    }    
}

