#include <stdlib.h>

#define MAXN 105

int adj[MAXN][MAXN];
int n;
int visited[MAXN];
int path[MAXN];
int pathlen;
int found;

void dfs(int u, int goal) {
    if (found) return;
    if (u == goal) {
        found = 1;
        return;
    }

    for (int v = 1; v <= n; v++) {
        if (adj[u][v] > 0 && !visited[v]) {
            visited[v] = 1;
            path[pathlen++] = v;

            for (int i = 0; i < adj[u][v]; i++) {
                dfs(v, goal);
                if (found) return;
            }

            pathlen--;
            visited[v] = 0;
        }
    }
}

int canReach(int start, int goal, int avoid) {
    memset(visited, 0, sizeof(visited));
    visited[start] = 1;
    visited[avoid] = 1;

    pathlen = 0;
    path[pathlen++] = start;
    found = 0;

    dfs(start, goal);
    return found;
}

