            if (H == 0 && W == 0) break;

            sc.nextLine();
            char[][] grid = new char[H][W];

            for (int i = 0; i < H; i++) {
                String line = sc.nextLine();
                for (int j = 0; j < W; j++) {
                    grid[i][j] = line.charAt(j);
                }
            }

            int[][] height = new int[H][W];

            for (int j = 0; j < W; j++) {
                for (int i = 0; i < H; i++) {
                    if (grid[i][j] == '*') {
                        height[i][j] = 0;
                    } else {
                        if (i == 0) {
                            height[i][j] = 1;
                        } else {
                            height[i][j] = height[i-1][j] + 1;
                        }
                    }
                }
            }

            int maxArea = 0;

            for (int i = 0; i < H; i++) {
                maxArea = Math.max(maxArea, largestRectangleInHistogram(height[i]));
            }

            System.out.println(maxArea);
        }

        sc.close();
    }

    static int largestRectangleInHistogram(int[] heights) {
        Stack<Integer> stack = new Stack<>();
        int maxArea = 0;
        int n = heights.length;

        for (int i = 0; i < n; i++) {
            while (!stack.isEmpty() && heights[i] < heights[stack.peek()]) {
                int h = heights[stack.pop()];
                int w = stack.isEmpty() ? i : i - stack.peek() - 1;
                maxArea = Math.max(maxArea, h * w);
            }
            stack.push(i);
        }

        while (!stack.isEmpty()) {
            int h = heights[stack.pop()];
            int w = stack.isEmpty() ? n : n - stack.peek() - 1;
            maxArea = Math.max(maxArea, h * w);
        }

        return maxArea;
    }
}

def maximal_rectangle(matrix):
    if not matrix or not matrix[0]:
        return 0

    H = len(matrix)
    W = len(matrix[0])

    # Build height matrix
    heights = [[0] * W for _ in range(H)]

    for j in range(W):
        for i in range(H):
            if matrix[i][j] == '.':
                if i == 0:
                    heights[i][j] = 1
                else:
                    heights[i][j] = heights[i-1][j] + 1
            else:
                heights[i][j] = 0

    # Find max rectangle for each row using histogram method
    max_area = 0

    for i in range(H):
        max_area = max(max_area, largest_rectangle_in_histogram(heights[i]))

    return max_area

def largest_rectangle_in_histogram(heights):
    stack = []
    max_area = 0
    index = 0

    while index < len(heights):
        if not stack or heights[index] >= heights[stack[-1]]:
            stack.append(index)
            index += 1
        else:
            top = stack.pop()
            width = index if not stack else index - stack[-1] - 1
            area = heights[top] * width
            max_area = max(max_area, area)

    while stack:
        top = stack.pop()
        width = index if not stack else index - stack[-1] - 1
        area = heights[top] * width
        max_area = max(max_area, area)

    return max_area

