double calc_width(int *order, int len) {
    if (len == 0) return 0;
    if (len == 1) return 2.0 * r[order[0]];

    double pos[12];
    pos[0] = r[order[0]];

    for (int i = 1; i < len; i++) {
        double max_pos = r[order[i]];

        for (int j = 0; j < i; j++) {
            double ri = r[order[i]];
            double rj = r[order[j]];
            double d = 2.0 * sqrt(ri * rj);
            double candidate = pos[j] + d;
            if (candidate > max_pos) {
                max_pos = candidate;
            }
        }

        pos[i] = max_pos;
    }

    double max_right = 0;
    for (int i = 0; i < len; i++) {
        double right = pos[i] + r[order[i]];
        if (right > max_right) {
            max_right = right;
        }
    }

    return max_right;
}

int try_permutation(int depth) {
