int encode(int state[8]) {
    int code = 0;
    int base = 1;
    for (int i = 7; i >= 0; i--) {
        int digit = state[i];
        for (int j = i + 1; j < 8; j++) {
            if (state[j] < state[i]) digit--;
        }
        code += digit * base;
        base *= (8 - i);
    }
    return code;
}

