    static int bfs(int[] initial) {
        if (Arrays.equals(initial, TARGET)) {
            return 0;
        }

        Queue<State> queue = new LinkedList<>();
        Set<String> visited = new HashSet<>();

        State start = new State(initial, 0);
        queue.offer(start);
