    static boolean lineIntersectsCircle(double x1, double y1, double x2, double y2, Circle circle) {
        double dx = x2 - x1;
        double dy = y2 - y1;
        double fx = x1 - circle.x;
        double fy = y1 - circle.y;

        double a = dx * dx + dy * dy;
        double b = 2 * (fx * dx + fy * dy);
