int w0[MAX_N][4];
char piece[MAX_N][4][MAX_H][MAX_W + 1];
int k;
int t[MAX_N];

void
bury(order_t *u)
{
	int s = u->s;
	int a = u->angle;
	int h = h0[s][a];
	int w = w0[s][a];

	for (int y = 0; y < h; ++y)
	{
		for (int x = 0; x < w; ++x)
		{
			if (piece[s][a][y][x] == '#')
				field[u->by + y][u->bx + x] = '*';
		}
	}
}

double
fitin(order_t *u, int a, int bx, int by)
{
	int s = u->s;
	int h = h0[s][a];
	int w = w0[s][a];

	int dx[4] = { 0, 1, 0,-1};
	int dy[4] = { 1, 0,-1, 0};

	int count = 0;
	int total = 0;
	for (int x = -1; x <= w; ++x)
	{
		int nx = bx + x;
		for (int y = -1; y <= h; ++y)
		{
			int ny = by + y;
			if (0 <= x && x < w && 0 <= y && y < h && piece[s][a][y][x] == '#')
			{
				if (0 <= nx && nx < W && 0 <= ny && ny < H && field[ny][nx] != '.')
					return -100.0;
			}
			else // piece[s][a][y][x] == '.' ?
			{
				int i;
				for (i = 0; i < 4; ++i)
				{
					int tx = x + dx[i], ty = y + dy[i];
					if (0 <= tx && tx < w && 0 <= ty && ty < h && piece[s][a][ty][tx] == '#')
						break;
				}

				if (i < 4)
				{
					total++;
					if (nx < 0 || W <= nx || ny < 0 || H <= ny || field[ny][nx] != '.')
						count++;
				}
			}
		}
	}

	return count * 100.0 / total;
}

void
probe(order_t *u)
{
	int s = u->s;
	for (int a = 0; a < 4; ++a)
	{
		int h = h0[s][a];
		int w = w0[s][a];

		int fx = strchr(piece[s][a][0], '#') - piece[s][a][0];
		for (int by = 0; by + h <= H; ++by)
