#ifdef DEBUG
					O++;
#endif
					double r = fitin(u, a, bx, by);
					if (r > u->rate)
					{
						u->rate = r;
						u->bx = bx;
						u->by = by;
						u->angle = a;

						if (u->rate >= 100.0)
						{
							bury(u);
							return;
						}
					}
				}
			}
		}
	}
}

int
cmp_func(const void *l_, const void *r_)
{
	const order_t *l = (const order_t*) l_;
	const order_t *r = (const order_t*) r_;

	if (l->rate < r->rate)
		return 1;

	if (l->rate > r->rate)
		return -1;

	return 0;
}

bool
solve()
