			// 2行目 三角形の第2の頂点の座標x2 y2（整数 整数；半角空白区切り）
			// 3行目 三角形の第3の頂点の座標x3 y3（整数 整数；半角空白区切り）
			// 4行目 円の中心の座標x4 y4（整数 整数；半角空白区切り）
			// 5行目 円の半径r（整数）
			//
