						ps[(i + 1) % 3]), ps[3]), Line.distanceSP(new Line(
						ps[i], ps[(i + 1) % 3]), ps[3]));
				min = Math.min(min, dis);
			}
			boolean right = true;
			boolean left = true;
			for (int i = 0; i < 3; i++) {
				double ep = new Line(ps[i], ps[(i + 1) % 3]).ep(new Line(ps[i],
						ps[3]));
