        if (a.sub(b).norm() < EPS) return a.sub(p).norm();
        Point ab = b.sub(a);
        Point ap = p.sub(a);
        double t = ap.dot(ab) / ab.dot(ab);
        if (t < 0) return ap.norm();
        if (t > 1) return p.sub(b).norm();
        Point projection = a.add(ab.mul(t));
        return p.sub(projection).norm();
    }

