        double d1 = b.sub(a).cross(p.sub(a));
        double d2 = c.sub(b).cross(p.sub(b));
        double d3 = a.sub(c).cross(p.sub(c));

        boolean hasNeg = (d1 < -EPS) || (d2 < -EPS) || (d3 < -EPS);
        boolean hasPos = (d1 > EPS) || (d2 > EPS) || (d3 > EPS);

        return !(hasNeg && hasPos);
