        return dfs(0, target);
    }

    static int dfs(int index, int remaining) {
        if (remaining == 0) {
            return 1;
        }
        if (remaining < 0 || index >= m) {
            return 0;
        }

        int total = 0;
        for (int i = 0; i <= counts[index]; i++) {
            int newRemaining = remaining - (i * values[index]);
            if (newRemaining < 0) break;
            total += dfs(index + 1, newRemaining);
        }

        return total;
    }
}

