def generate_hamming_numbers(limit):
    hamming = set([1])
    heap = [1]

    while heap:
        h = heapq.heappop(heap)
        if h > limit:
            break

        for factor in [2, 3, 5]:
            new_num = h * factor
            if new_num <= limit and new_num not in hamming:
                hamming.add(new_num)
                heapq.heappush(heap, new_num)

