    is_prime[0] = is_prime[1] = 0;

    for (int i = 2; i * i <= MP; i++) {
        if (is_prime[i]) {
            for (int j = i * i; j <= MP; j += i) {
                is_prime[j] = 0;
            }
        }
    }

    for (int i = 2; i <= MP; i++) {
        if (is_prime[i]) {
            primes[prime_count++] = i;
        }
    }
}

int binary_search_lower(int val) {
    int left = 0, right = prime_count - 1;
    int result = prime_count;

    while (left <= right) {
        int mid = (left + right) / 2;
        if (primes[mid] >= val) {
            result = mid;
            right = mid - 1;
        } else {
            left = mid + 1;
        }
    }
    return result;
}

int binary_search_upper(int val) {
    int left = 0, right = prime_count - 1;
    int result = -1;

    while (left <= right) {
        int mid = (left + right) / 2;
        if (primes[mid] <= val) {
            result = mid;
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }
    return result;
}

