import java.util.*;

public class Main {
    static class Food {
        String name;
        int weight;
        int strength;

        Food(String name, int weight, int strength) {
            this.name = name;
            this.weight = weight;
            this.strength = strength;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            if (n == 0) break;

            Food[] foods = new Food[n];
            for (int i = 0; i < n; i++) {
                String name = sc.next();
                int weight = sc.nextInt();
                int strength = sc.nextInt();
                foods[i] = new Food(name, weight, strength);
            }

            int[] bestPerm = null;
            double minG = Double.MAX_VALUE;

            int[] perm = new int[n];
            for (int i = 0; i < n; i++) {
                perm[i] = i;
            }

            do {
                if (isValid(foods, perm)) {
                    double g = calculateG(foods, perm);
                    if (g < minG) {
                        minG = g;
                        bestPerm = perm.clone();
                    }
                }
            } while (nextPermutation(perm));

            for (int i = 0; i < n; i++) {
                System.out.println(foods[bestPerm[i]].name);
            }
        }

        sc.close();
    }

    static boolean isValid(Food[] foods, int[] perm) {
        int n = perm.length;
        for (int i = 0; i < n; i++) {
            int weightAbove = 0;
            for (int j = i + 1; j < n; j++) {
                weightAbove += foods[perm[j]].weight;
            }
            if (foods[perm[i]].strength < weightAbove) {
                return false;
            }
        }
        return true;
    }

    static double calculateG(Food[] foods, int[] perm) {
        int n = perm.length;
        double numerator = 0;
        double denominator = 0;
        for (int i = 0; i < n; i++) {
            numerator += (i + 1) * foods[perm[i]].weight;
            denominator += foods[perm[i]].weight;
        }
        return numerator / denominator;
    }

    static boolean nextPermutation(int[] array) {
        int i = array.length - 2;
        while (i >= 0 && array[i] >= array[i + 1]) {
            i--;
        }

        if (i < 0) {
            return false;
        }

        int j = array.length - 1;
        while (array[j] <= array[i]) {
            j--;
        }

        swap(array, i, j);
        reverse(array, i + 1, array.length - 1);
        return true;
    }

    static void swap(int[] array, int i, int j) {
        int temp = array[i];
        array[i] = array[j];
        array[j] = temp;
    }

    static void reverse(int[] array, int start, int end) {
        while (start < end) {
            swap(array, start, end);
            start++;
            end--;
        }
    }
}

