int grid[MAX_HEIGHT][WIDTH];

int getHeight(int col) {
    int h = 0;
    for (int i = 0; i < MAX_HEIGHT; i++) {
        if (grid[i][col] == 1) {
            h = i + 1;
        }
    }
    return h;
}

void dropBlock(int d, int p, int q) {
    q--; // Convert to 0-indexed

    if (d == 1) { // Horizontal
        // Find the highest point where the block can land
        int maxHeight = 0;
        for (int i = 0; i < p; i++) {
            int h = getHeight(q + i);
            if (h > maxHeight) {
                maxHeight = h;
            }
        }
        // Place the block
        for (int i = 0; i < p; i++) {
            grid[maxHeight][q + i] = 1;
        }
    } else { // Vertical (d == 2)
        int h = getHeight(q);
        // Place the block
        for (int i = 0; i < p; i++) {
            grid[h + i][q] = 1;
        }
    }
}

void removeFullRows() {
    int removed = 0;
    for (int row = 0; row < MAX_HEIGHT; row++) {
        int full = 1;
        for (int col = 0; col < WIDTH; col++) {
            if (grid[row][col] == 0) {
                full = 0;
                break;
            }
        }
        if (full) {
            // Mark row for removal
            for (int col = 0; col < WIDTH; col++) {
                grid[row][col] = 0;
            }
            // Shift everything above down
            for (int r = row; r < MAX_HEIGHT - 1; r++) {
                for (int col = 0; col < WIDTH; col++) {
                    grid[r][col] = grid[r + 1][col];
                }
            }
            for (int col = 0; col < WIDTH; col++) {
                grid[MAX_HEIGHT - 1][col] = 0;
            }
            row--; // Check this row again
        }
    }
}

int countBlocks() {
    int count = 0;
    for (int i = 0; i < MAX_HEIGHT; i++) {
        for (int j = 0; j < WIDTH; j++) {
