int hexDistance(int r1, int c1, int r2, int c2)
{
	int dr, dc, c;
	dr = abs(r2 - r1), dc = abs(c2 - c1);
	if (r2 == r1) return dc;
	if (c2 == c1) return dr;
	if (r2 < r1) c = r2, r2 = r1, r1 = c, c = c2, c2 = c1, c1 = c;
