import java.util.*;

public class Main {
    static class Edge {
        int to, cost, time;
        Edge(int to, int cost, int time) {
            this.to = to;
            this.cost = cost;
            this.time = time;
        }
    }

    static class State implements Comparable<State> {
        int node, value;
        State(int node, int value) {
            this.node = node;
            this.value = value;
        }
        public int compareTo(State other) {
            return this.value - other.value;
        }
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        while (true) {
            int n = sc.nextInt();
            int m = sc.nextInt();

            if (n == 0 && m == 0) break;

            List<Edge>[] graph = new ArrayList[m + 1];
            for (int i = 0; i <= m; i++) {
                graph[i] = new ArrayList<>();
            }

            for (int i = 0; i < n; i++) {
                int a = sc.nextInt();
                int b = sc.nextInt();
                int cost = sc.nextInt();
                int time = sc.nextInt();
                graph[a].add(new Edge(b, cost, time));
                graph[b].add(new Edge(a, cost, time));
            }

            int k = sc.nextInt();
            for (int i = 0; i < k; i++) {
                int p = sc.nextInt();
                int q = sc.nextInt();
                int r = sc.nextInt();

                if (r == 0) {
                    System.out.println(dijkstra(graph, m, p, q, true));
                } else {
                    System.out.println(dijkstra(graph, m, p, q, false));
                }
            }
        }
        sc.close();
    }

    static int dijkstra(List<Edge>[] graph, int m, int start, int end, boolean useCost) {
        int[] dist = new int[m + 1];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[start] = 0;

        PriorityQueue<State> pq = new PriorityQueue<>();
        pq.offer(new State(start, 0));

        while (!pq.isEmpty()) {
            State current = pq.poll();
            int u = current.node;
            int d = current.value;

            if (d > dist[u]) continue;

            for (Edge edge : graph[u]) {
                int v = edge.to;
                int weight = useCost ? edge.cost : edge.time;

                if (dist[u] + weight < dist[v]) {
                    dist[v] = dist[u] + weight;
                    pq.offer(new State(v, dist[v]));
                }
            }
        }

        return dist[end];
    }
}

