#include <stdio.h>
#include <string.h>

#define HSIZ 499
typedef struct { char *w; int k; } HASH;
HASH hash[HSIZ + 5];

int lookup(char *w)
{
	int i, l;
	HASH *tp;
	i = (101 * *w + 103 * *(w + (l = strlen(w)) - 1) + 107 * l) % HSIZ;
	tp = hash + i;
	if (tp->w != NULL) {
		int inc = *w + (*(w + 1) << 1);
		while (1) {
			if (!strcmp(tp->w, w)) return tp->k;
			i += inc; if (i >= HSIZ) i -= HSIZ;
			tp = hash + i;
			if (tp->w == NULL) break;
		}
	}
	return -1;
}

int insert(char *w, int k)
{
	int i, l;
	HASH *tp;
	i = (101 * *w + 103 * *(w + (l = strlen(w)) - 1) + 107 * l) % HSIZ;
	tp = hash + i;
	if (tp->w != NULL) {
		int inc = *w + (*(w + 1) << 1);
		while (1) {
			if (!strcmp(tp->w, w)) return -1;
			i += inc; if (i >= HSIZ) i -= HSIZ;
			tp = hash + i;
			if (tp->w == NULL) break;
		}
	}
	tp->w = w, tp->k = k;
	return 0;
}

typedef struct { char a[102]; int m, k, i[102]; } MONO;
MONO mono[205]; int no;

int combi(int a)
{
	int i, k, c = -1;
	k = mono[a].k;
	if (k > 0) for (c = i = 0; i < k; i++) c += combi(mono[a].i[i]);
	if (c < 0 || (mono[a].m >= 0 && mono[a].m < c)) c = mono[a].m;
	return c;
}

int main()
{
	int i, j, k, N, M;
