            continue

        # Check if total is not divisible by any number from 2 to total-1
        is_prime_like = True
        for divisor in range(2, int(math.sqrt(total)) + 1):
            if total % divisor == 0:
                is_prime_like = False
                break

        if is_prime_like and total > 1:
