#include <string.h>

int X, Y;
int course[16][16];
long long dp[16][16];

long long countPaths() {
    memset(dp, 0, sizeof(dp));

    // Initialize first row (y=1)
    for (int x = 1; x <= X; x++) {
        if (course[x][1] != 1) {  // Not an obstacle
            dp[x][1] = 1;
        }
    }

    // Fill the dp table
    for (int y = 1; y < Y; y++) {
        for (int x = 1; x <= X; x++) {
            if (dp[x][y] == 0) continue;

            if (course[x][y] == 2) {  // Jump platform
                // Jump to (x, y+2)
                if (y + 2 <= Y) {
                    if (course[x][y+2] != 1) {
                        dp[x][y+2] += dp[x][y];
                    }
                } else {
                    // Jump goes beyond Y, count as reaching goal
                    dp[x][Y] += dp[x][y];
                }
            } else {  // Normal cell (0)
                // Move to (x-1, y+1), (x, y+1), (x+1, y+1)
                for (int dx = -1; dx <= 1; dx++) {
                    int nx = x + dx;
                    int ny = y + 1;

                    if (nx < 1 || nx > X) continue;

                    if (ny > Y) {
                        // Reached goal
                        dp[x][Y] += dp[x][y];
                    } else {
                        if (course[nx][ny] == 1) {  // Obstacle
                            continue;
                        }
                        if (course[nx][ny] == 2) {  // Jump platform
                            // Can only enter jump platform from directly above (dx == 0)
                            if (dx == 0) {
                                dp[nx][ny] += dp[x][y];
                            }
                        } else {  // Normal cell
                            dp[nx][ny] += dp[x][y];
                        }
                    }
                }
            }
        }
    }

    // Sum all paths that reached Y
    long long total = 0;
    for (int x = 1; x <= X; x++) {
        total += dp[x][Y];
    }

    return total;
}

int main() {
    while (1) {
        scanf("%d %d", &X, &Y);
        if (X == 0 && Y == 0) break;

        for (int y = 1; y <= Y; y++) {
            for (int x = 1; x <= X; x++) {
                scanf("%d", &course[x][y]);
            }
        }

        printf("%lld\n", countPaths());
    }

    return 0;
}

