    static boolean laserHits(double lx, double ly, UFO ufo) {
        // Laser goes from origin through (lx, ly)
        // Check if it intersects circle at (ufo.x, ufo.y) with radius ufo.r

        double laserLen = Math.sqrt(lx * lx + ly * ly);
