long long convert(long long n) {
    long long result = 0;
    long long base = 1;

    while (n > 0) {
        long long digit = n % 10;
        n /= 10;

        if (digit >= 4) digit++;
        if (digit >= 6) digit++;

        result = digit * base + result;
        base *= 10;
    }

    return result;
}

