    long long answer = 1;

    while (left <= right) {
        long long mid = left + (right - left) / 2;
        long long converted = convert(mid);

        if (converted == n) {
            return n;
        } else if (converted < n) {
            answer = converted;
            left = mid + 1;
        } else {
            right = mid - 1;
