class FizzBuzz {
	private int current,currentPlayer;
	private int m;
	private int[] player;

	public FizzBuzz(int m) {
		current = 0;
		currentPlayer = 0;
		this.m = m;
		player = new int[m];
		for(int i=0; i<m; i++) {
			player[i] = i+1;
		}
	}

	public void showPlayer() {
		for(int pl:player){
			if(pl != -1){
				System.out.println(pl);
			}
		}
	}

	public boolean sayNextStatement(String statement) {
		try {
			int num = Integer.valueOf(statement);
			if(!checkFizzBuzz(num)) {
				player[currentPlayer] = -1;
			}
		} catch(NumberFormatException e) {
			if(!checkFizzBuzz(statement)) {
				player[currentPlayer] = -1;
			}
		}

		if(!setCurrentPlayer()) {
			return false;
		}

		return true;
	}

	private boolean setCurrentPlayer() {
		int prev = currentPlayer;

		if(currentPlayer+1 == m) {
			currentPlayer = 0;
		} else {
			currentPlayer ++;
		}

		while(player[currentPlayer] == -1) {
			if(currentPlayer+1 == m) {
				currentPlayer = 0;
			} else {
				currentPlayer ++;
			}

			if(prev == currentPlayer) {
				return false;
			}
		}

		return true;
	}

	private boolean checkFizzBuzz(int statement) {
		current ++;

		if((current % 3 == 0) || (current % 5 == 0)) {
			return false;
		} else {
			if(current == statement) {
				return true;
			} else {
				return false;
			}
		}
	}

	private boolean checkFizzBuzz(String statement) {
		current ++;
		if((current % 3 == 0) && (current % 5 == 0)) {
			if(statement.equals("FizzBuzz")) {
				return true;
			} else {
				return false;
			}
		} else if(current % 3 == 0) {
			if(statement.equals("Fizz")) {
				return true;
			} else {
				return false;
			}
		} else if(current % 5 == 0) {
			if(statement.equals("Buzz")) {
				return true;
			} else {
				return false;
			}
		} else {
			return false;
		}
	}
