public class Main {
    static class State {
        int building; // 0 or 1
        int floor;
        int jumps;

        State(int building, int floor, int jumps) {
            this.building = building;
            this.floor = floor;
            this.jumps = jumps;
        }
    }

    public static void main(String[] args) {
