            // Climb ladder to the top
            int top = floor;
            while (top < n && wall[top] == 1) {
                top++;
            }
            return top;
        } else { // wall[floor] == 2
            // Slide down
            int slideFloor = floor;
            while (slideFloor > 1) {
                slideFloor--;
