                    new_oxygen = min(m, oxygen + cell_value) - 1
                    if new_oxygen >= 0:
                        new_used = used | frozenset([(nx, ny)])
                        new_state = (nx, ny, new_oxygen, new_used)
                        if new_state not in visited:
                            heapq.heappush(pq, (cost, nx, ny, new_oxygen, new_used))

    return None

